import React, { Component } from 'react';
  
export default class About extends Component {
  render() {
    return (
      <div>
        <p>Design your About me page </p> 
        <h1>About Me</h1>
        <img src="./my_image.jpg" alt="A portrait of myself"></img>
        <h2>Introduction</h2>
        <p>I am a rising junior attending the University of Virginia.</p>
        <h2>Interests</h2>
        <p>I am interested in...</p>
      </div>
    )
  }
}
